import React from "react";
import { Carousel } from "react-responsive-carousel";

const Skills = () => {
  return (
    <>
      <div className="title">
        <h1>Skills</h1>
      </div>
      <div className="skills-carousel">
        <Carousel></Carousel>
      </div>
    </>
  );
};

export default Skills;
